DROP TABLE IF EXISTS `view_deviceoffline`;

CREATE ALGORITHM=UNDEFINED DEFINER=`laravel`@`%` SQL SECURITY DEFINER VIEW `view_deviceoffline` AS select `device`.`timestamp_last_accessed` AS `last_accessed`,timestampdiff(MINUTE,`device`.`timestamp_last_accessed`,current_timestamp()) AS `off_minutes`,`device`.`id` AS `id`,`device`.`description` AS `description`,`device`.`device_code` AS `device_code`,`clients`.`description` AS `clientname`,`clients`.`supervisor_email` AS `supervisor_email` from (`device` join `clients` on(`device`.`client_id` = `clients`.`id`)) where timestampdiff(MINUTE,`device`.`timestamp_last_accessed`,current_timestamp()) > `device`.`device_heartbeat_minutes` * 2 and curtime() > `device`.`device_up_time` and curtime() < `device`.`device_down_time` and `device`.`device_heartbeat_minutes` > 0 and `device`.`supervisor_warning` = 0;
DROP TABLE IF EXISTS `view_deviceonline`;

CREATE ALGORITHM=UNDEFINED DEFINER=`laravel`@`%` SQL SECURITY DEFINER VIEW `view_deviceonline` AS select `device`.`timestamp_last_accessed` AS `last_accessed`,timestampdiff(MINUTE,`device`.`timestamp_last_accessed`,current_timestamp()) AS `off_minutes`,`device`.`id` AS `id`,`device`.`description` AS `description`,`device`.`device_code` AS `device_code`,`clients`.`description` AS `clientname`,`clients`.`supervisor_email` AS `supervisor_email` from (`device` join `clients` on(`device`.`client_id` = `clients`.`id`)) where timestampdiff(MINUTE,`device`.`timestamp_last_accessed`,current_timestamp()) < `device`.`device_heartbeat_minutes` * 3 and `device`.`supervisor_warning` = 1;
